import * as React from 'react';
import Box from '@mui/material/Box';
import Link from '@mui/material/Link';
import AppBar from '../components/AppBar';
import Toolbar from '../components/Toolbar';
// Import useNavigate
import { useNavigate } from 'react-router-dom';

const rightLink = {
  fontSize: 16,
  color: 'common.white',
  ml: 3,
};

function AppAppBar() {
  // Use useNavigate hook
  const navigate = useNavigate();

  // Custom handler for navigation
  const handleNavigate = (path) => () => {
    navigate(path);
  };

  return (
    <div>
      <AppBar position="fixed">
        <Toolbar sx={{ justifyContent: 'space-between' }}>
          <Box sx={{ flex: 1 }} />
          <Link
            variant="h6"
            underline="none"
            color="inherit"
            onClick={handleNavigate('/')}
            sx={{ fontSize: 24, cursor: 'pointer' }} // Add cursor style for better UX
          >
            {'Tennessean Travel Stop'}
          </Link>
          <Box sx={{ flex: 1, display: 'flex', justifyContent: 'flex-end' }}>
            <Link
              variant="body2"
              underline="none"
              sx={{ ...rightLink, cursor: 'pointer' }} // Add cursor style
              onClick={handleNavigate('/onep/sign-in/')}
            >
              {'Sign In'}
            </Link>
            <Link
              variant="body2"
              underline="none"
              sx={{ ...rightLink, color: 'secondary.main', cursor: 'pointer' }} // Add cursor style
              onClick={handleNavigate('/onep/sign-up/')}
            >
              {'Sign Up'}
            </Link>
          </Box>
        </Toolbar>
      </AppBar>
      <Toolbar />
    </div>
  );
}

export default AppAppBar;
